import './Notices.css';

const notices = [
  { title: "Admission Open 2025", date: "June 20, 2025" },
  { title: "Mid-Term Exam Dates Released", date: "July 3, 2025" },
  { title: "Holiday on 15th August (Independence Day)", date: "July 5, 2025" }
];

function Notices() {
  return (
    <div className="notices">
      <h1>Latest Notices</h1>
      <ul>
        {notices.map((notice, index) => (
          <li key={index}>
            <h3>{notice.title}</h3>
            <p>{notice.date}</p>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Notices;
